def findAnagrams(s, p):
    """
    :type s: str
    :type p: str
    :rtype: List[int]
    """
    output = []
    map_p = {}
    map_a = {}

    if len(s)<1 or len(p)> len(s):
        return output

    else:

        for i in p:
            if i in map_p:
                map_p[i] += 1
            else:
                map_p[i] = 1

        for i in range(0, len(p)): # build the initial map
            if s[i] in map_a:
                map_a[s[i]] +=1
            else:
                map_a[s[i]] = 1

        if map_a==map_p:
            output.append(0)


        for i in range(1, len(s)- len(p) +1):
            if map_a[s[i-1]]==1:
                del map_a[s[i - 1]]
            else:
                map_a[s[i - 1]] -= 1

            if s[i + len(p)-1] in map_a:
                map_a[s[i + len(p)-1]] +=1
            else:
                map_a[s[i + len(p)-1]] = 1
            #print(map_a)
            if map_a == map_p:
                output.append(i)
        return output


print(findAnagrams("" , "ab"))
print(findAnagrams("abab" , "ab"))
print(findAnagrams("cbaebabacd" , "abc"))
print(findAnagrams("aaaaaaaaaa" , "aaaaaaaaaaaaa"))
print(findAnagrams(""
                   ,""))
